function Player( props ) {
    return (
        <div id="player-box">
            <div id="player-box-title">
                <h2>{props.web_name} ({props.short_name})</h2>
            </div> 
            <div id="team-name-and-color-container">
                <div style={{ background: 'linear-gradient(to right, '+props.backgroundColor1+' 0%, '+ props.backgroundColor1+' 50%, '+props.backgroundColor2+' 50%, '+props.backgroundColor2+' 100%)'}} id="team-color-box">
                </div>
            </div>
            <div id="player-box-labels-and-values-container">
                <div id="player-box-labels">
                    <p>Price:</p>
                    <p>Total points:</p>
                    <p>Minutes:</p>
                    <p>Points/games:</p>
                    <p>Points/price:</p>
                    <p>Points/price/games:</p>
                </div>
                <div id="player-box-values">
                    <p>{props.price.toFixed(1)}</p>
                    <p>{props.total_points}</p>
                    <p>{props.minutes}</p>
                    <p>{props.points_per_game.toFixed(4)}</p>
                    <p>{props.points_per_price.toFixed(4)}</p>
                    <p>{props.points_per_price_per_game.toFixed(4)}</p>
                </div>
            </div>
            <div id="player-show-fixtures-short">
                {props.nextFiveFix.map((fixture) => {
                    const [ gw, opponent, diffuculty, location ] = fixture;
                    return (
                        <Fixture gw={gw} opponent={opponent} location={location} difficulty={diffuculty}/>
                    )
                })}
            </div>
            
        </div>
    )
}

function Fixture( props ) {
    return (
        <div style={{ backgroundColor: 'blue'}}id="fixture-box">
            <p>{props.opponent} ({props.location})</p>
        </div>
    )
}

function getBackgroundColor(diff) {
    let color = ''
    switch (diff) {
        case 1:
            color = 'rgb(55, 85, 35)'
            break;
    }
}

export default Player;
